function loadNextPixel() {
  if(curCall < anas.length && stop == 0) {
    loadPixel(anas[curCall], curCall + 1);
    curCall++;

};
function loadPixel(anaId, n) {
  var elem = document.createElement('img');
  if (elem.addEventListener) {
    elem.addEventListener('load',loadNextPixel,false);

  } else if (elem.attachEvent) {
    elem.attachEvent('onload',loadNextPixel);
    elem.attachEvent('onerror',loadNextPixel);
  }

  elem.hspace = '0';
  elem.vspace = '0';
  elem.width = '1';
  elem.height = '1';
  elem.src = 'https://rc.rlcdn.com/350041.gif?n=' + n + '&ana=' + anaId;
  document.body.appendChild(elem);
};
function extraCalls() {
  loadNextPixel();
  loadNextPixel();
  loadNextPixel();
  loadNextPixel();
  loadNextPixel();
}
function stopCalls() {
  stop = 1;
}
function extraCallsWithTimeout() {
  window.setTimeout('extraCalls()',500);
}
if (window.addEventListener) {
  window.addEventListener('load',extraCallsWithTimeout,false);
} else if (window.attachEvent) {
  window.attachEvent('onload',extraCallsWithTimeout);
}
</script></head>
